// SPDX-License-Identifier: MIT
pragma solidity 0.8.20;

import "@openzeppelin/contracts@5.0.0/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts@5.0.0/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts@5.0.0/access/Ownable.sol";
import "@openzeppelin/contracts@5.0.0/token/ERC20/utils/SafeERC20.sol";

// --- CUSTOM ERRORS ---
error ZeroAddress();
error IdenticalAddresses();
error ZeroAmount();
error NoLiquidity();
error InsufficientOutput();
error InvalidToken();
error ExcessiveSlippage();
error InsufficientReserve();

/**
 * @title MyHyperOptimizedDEX
 * @author Production-Ready DEX
 * @notice A production-grade, gas-optimized, and hardened AMM with MEV protection.
 * @dev Implements constant product formula (x*y=k) with 0.3% trading fee.
 */
contract MyHyperOptimizedDEX is ReentrancyGuard, Ownable {
    using SafeERC20 for IERC20;

    // --- CONSTANTS ---
    /// @notice Trading fee numerator (0.3% = 997/1000)
    uint256 private constant FEE_NUMERATOR = 997;
    /// @notice Trading fee denominator
    uint256 private constant FEE_DENOMINATOR = 1000;
    /// @notice Maximum slippage tolerance (10%)
    uint256 private constant MAX_SLIPPAGE_BPS = 1000;
    uint256 private constant BPS_DENOMINATOR = 10000;

    // --- STATE VARIABLES ---
    IERC20 public immutable tokenA;
    IERC20 public immutable tokenB;

    /// @notice Reserve of Token A in the pool
    uint256 public reserveA;
    /// @notice Reserve of Token B in the pool
    uint256 public reserveB;
    
    /// @notice Total liquidity shares (for future LP token implementation)
    uint256 public totalLiquidity;

    // --- EVENTS ---
    /// @notice Emitted when a swap occurs
    /// @param sender Address initiating the swap
    /// @param amountIn Amount of input tokens
    /// @param amountOut Amount of output tokens received
    /// @param tokenIn Address of input token
    /// @param tokenOut Address of output token
    event Swapped(
        address indexed sender,
        uint256 amountIn,
        uint256 amountOut,
        address indexed tokenIn,
        address indexed tokenOut
    );

    /// @notice Emitted when liquidity is added
    /// @param provider Address providing liquidity
    /// @param amountA Amount of Token A added
    /// @param amountB Amount of Token B added
    /// @param liquidity Liquidity shares minted
    event LiquidityAdded(
        address indexed provider,
        uint256 amountA,
        uint256 amountB,
        uint256 liquidity
    );

    /// @notice Emitted when emergency withdrawal occurs
    /// @param token Token withdrawn
    /// @param amount Amount withdrawn
    event EmergencyWithdraw(address indexed token, uint256 amount);

    // --- MODIFIERS ---
    /// @dev Ensures pool has liquidity before swap operations
    modifier hasLiquidity() {
        if (reserveA == 0 || reserveB == 0) revert NoLiquidity();
        _;
    }

    /**
     * @notice Initializes the DEX with two ERC20 tokens
     * @param tokenAAddress Address of first token
     * @param tokenBAddress Address of second token
     * @dev Validates addresses and ensures tokens are different
     */
    constructor(
        address tokenAAddress,
        address tokenBAddress
    ) Ownable(msg.sender) ReentrancyGuard() {
        if (tokenAAddress == address(0) || tokenBAddress == address(0)) {
            revert ZeroAddress();
        }
        if (tokenAAddress == tokenBAddress) {
            revert IdenticalAddresses();
        }

        tokenA = IERC20(tokenAAddress);
        tokenB = IERC20(tokenBAddress);
    }

    /**
     * @notice Adds liquidity to the pool
     * @param amountA Amount of Token A to add
     * @param amountB Amount of Token B to add
     * @dev Follows Checks-Effects-Interactions pattern
     * @dev Uses SafeERC20 for secure token transfers
     */
    function addLiquidity(
        uint256 amountA,
        uint256 amountB
    ) external nonReentrant {
        // --- CHECKS ---
        if (amountA == 0 || amountB == 0) {
            revert ZeroAmount();
        }

        // Calculate liquidity shares (simplified for this implementation)
        uint256 liquidity;
        if (totalLiquidity == 0) {
            // First liquidity provider
            liquidity = amountA + amountB;
        } else {
            // Subsequent providers get proportional shares
            liquidity = (amountA * totalLiquidity) / reserveA;
        }

        // --- EFFECTS ---
        reserveA += amountA;
        reserveB += amountB;
        totalLiquidity += liquidity;

        // --- INTERACTIONS ---
        tokenA.safeTransferFrom(msg.sender, address(this), amountA);
        tokenB.safeTransferFrom(msg.sender, address(this), amountB);

        emit LiquidityAdded(msg.sender, amountA, amountB, liquidity);
    }

    /**
     * @notice Swaps Token A for Token B with MEV protection
     * @param amountInA Exact amount of Token A being sent
     * @param amountOutMin Minimum amount of Token B to accept (slippage protection)
     * @dev Implements Uniswap V2 constant product formula with 0.3% fee
     * @dev Prevents MEV attacks through slippage checks
     */
    function swapTokenAForTokenB(
        uint256 amountInA,
        uint256 amountOutMin
    ) external nonReentrant hasLiquidity {
        // --- CHECKS ---
        if (amountInA == 0) revert ZeroAmount();
        if (amountOutMin == 0) revert ZeroAmount();

        // Calculate output amount using constant product formula
        uint256 amountInWithFee = amountInA * FEE_NUMERATOR;
        uint256 numerator = amountInWithFee * reserveB;
        uint256 denominator = (reserveA * FEE_DENOMINATOR) + amountInWithFee;
        uint256 amountOutB = numerator / denominator;

        // Slippage protection
        if (amountOutB < amountOutMin) {
            revert InsufficientOutput();
        }

        // Additional safety: ensure sufficient reserve
        if (amountOutB > reserveB) {
            revert InsufficientReserve();
        }

        // Validate slippage is within reasonable bounds (10% max)
        uint256 maxSlippage = (amountOutB * MAX_SLIPPAGE_BPS) / BPS_DENOMINATOR;
        if (amountOutB - amountOutMin > maxSlippage) {
            revert ExcessiveSlippage();
        }

        // --- EFFECTS ---
        reserveA += amountInA;
        reserveB -= amountOutB;

        // --- INTERACTIONS ---
        tokenA.safeTransferFrom(msg.sender, address(this), amountInA);
        tokenB.safeTransfer(msg.sender, amountOutB);

        emit Swapped(
            msg.sender,
            amountInA,
            amountOutB,
            address(tokenA),
            address(tokenB)
        );
    }

    /**
     * @notice Swaps Token B for Token A with MEV protection
     * @param amountInB Exact amount of Token B being sent
     * @param amountOutMin Minimum amount of Token A to accept (slippage protection)
     * @dev Mirror function of swapTokenAForTokenB for reverse swaps
     */
    function swapTokenBForTokenA(
        uint256 amountInB,
        uint256 amountOutMin
    ) external nonReentrant hasLiquidity {
        // --- CHECKS ---
        if (amountInB == 0) revert ZeroAmount();
        if (amountOutMin == 0) revert ZeroAmount();

        // Calculate output amount
        uint256 amountInWithFee = amountInB * FEE_NUMERATOR;
        uint256 numerator = amountInWithFee * reserveA;
        uint256 denominator = (reserveB * FEE_DENOMINATOR) + amountInWithFee;
        uint256 amountOutA = numerator / denominator;

        // Slippage protection
        if (amountOutA < amountOutMin) {
            revert InsufficientOutput();
        }

        if (amountOutA > reserveA) {
            revert InsufficientReserve();
        }

        // --- EFFECTS ---
        reserveB += amountInB;
        reserveA -= amountOutA;

        // --- INTERACTIONS ---
        tokenB.safeTransferFrom(msg.sender, address(this), amountInB);
        tokenA.safeTransfer(msg.sender, amountOutA);

        emit Swapped(
            msg.sender,
            amountInB,
            amountOutA,
            address(tokenB),
            address(tokenA)
        );
    }

    /**
     * @notice Gets current reserves for both tokens
     * @return _reserveA Current reserve of Token A
     * @return _reserveB Current reserve of Token B
     * @dev View function for external integrations
     */
    function getReserves() external view returns (uint256 _reserveA, uint256 _reserveB) {
        _reserveA = reserveA;
        _reserveB = reserveB;
    }

    /**
     * @notice Calculates output amount for a given input (view function)
     * @param amountIn Input token amount
     * @param reserveIn Reserve of input token
     * @param reserveOut Reserve of output token
     * @return amountOut Expected output amount
     * @dev Useful for frontends to calculate expected output before swapping
     */
    function getAmountOut(
        uint256 amountIn,
        uint256 reserveIn,
        uint256 reserveOut
    ) external pure returns (uint256 amountOut) {
        if (amountIn == 0) revert ZeroAmount();
        if (reserveIn == 0 || reserveOut == 0) revert NoLiquidity();

        uint256 amountInWithFee = amountIn * FEE_NUMERATOR;
        uint256 numerator = amountInWithFee * reserveOut;
        uint256 denominator = (reserveIn * FEE_DENOMINATOR) + amountInWithFee;
        amountOut = numerator / denominator;
    }

    /**
     * @notice Emergency withdrawal of tokens (owner only)
     * @param token Token to withdraw
     * @dev Only allows withdrawal of tokenA or tokenB
     * @dev Should only be used in emergency situations
     */
    function emergencyWithdraw(IERC20 token) external onlyOwner {
        if (
            address(token) != address(tokenA) &&
            address(token) != address(tokenB)
        ) {
            revert InvalidToken();
        }
        
        uint256 balance = token.balanceOf(address(this));
        if (balance == 0) revert ZeroAmount();
        
        token.safeTransfer(msg.sender, balance);
        
        emit EmergencyWithdraw(address(token), balance);
    }
}

